import Data from './ApiData.json';
const Api = () => {
    
    // MAIN SLIDER CONTENT
    let SliderContent = Data.SliderContent_;
    // =======================================
    // SERVICES CONTENT
    let ServicesContent = Data.services_dates;
    // =======================================

    // RETURN VARIABLES OF DATA
    return SliderContent, ServicesContent;
}
export default Api;
